import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import ClientList from './components/ClientList';
import ClientFilter from './components/ClientFilter';
import ClientForm from './components/ClientForm';
import CalcRota from './components/CalcRota';
function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/client-form">Client Form</Link>
            </li>
            <li>
              <Link to="/client-filter">Client Filter</Link>
            </li>
            <li>
              <Link to="/client-list">Client List</Link>
            </li>
            <li>
              <Link to="/calc-rota">Calc Rota</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/client-form" component={ClientForm} />
          <Route path="/client-filter" component={ClientFilter} />
          <Route path="/client-list" component={ClientList} />
          <Route path="/calc-rota" component={CalcRota} />
        </Switch>
      </div>
    </Router>
 );
}

export default App;
